import React from "react";
import { Col, Container, Row } from "react-bootstrap";

export default function MainLayout() {
  return (
    <Container>
      <Row className="justify-content-md-center">
        <Col>
          <div className="main-layout"></div>
        </Col>
      </Row>
    </Container>
  );
}
